import React from 'react'
import { Layout } from 'antd';

const {  Content } = Layout;
function App({children}){

return<Layout>
// Header
<Layout>
// sider
  <Layout style={{ padding: '0 24px 24px' }}>
    // breadcrump
    <Content
      className="site-layout-background"
      style={{
        padding: 24,
        margin: 0,
        minHeight: 280,
      }}
    >
      Content
    </Content>
    // footer
  </Layout>
</Layout>
</Layout>
}

export default App
